import React, { useState } from "react";
import watch1 from "../assets/watch1.png";
import watch2 from "../assets/watch2.png";
import watch3 from "../assets/watch3.png";
import watch4 from "../assets/watch4.png";
import watch5 from "../assets/watch5.png";
import watch6 from "../assets/watch6.png";
import watch7 from "../assets/watch7.png";
import watch8 from "../assets/watch8.png";

const Products = () => {
  const [items] = useState([
    {
      id: 1,
      name: "Watch 1",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch1,
    },
    {
      id: 2,
      name: "Watch 2",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch2,
    },
    {
      id: 3,
      name: "Watch 3",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch3,
    },
    {
      id: 4,
      name: "Watch 4",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch4,
    },
    {
      id: 5,
      name: "Watch 5",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch5,
    },
    {
      id: 6,
      name: "Watch 6",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch6,
    },
    {
      id: 7,
      name: "Watch 7",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch7,
    },
    {
      id: 8,
      name: "Watch 8",
      quantity: 1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
      imageUrl: watch8,
    },
  ]);

  const [selectedItems, setSelectedItems] = useState([]);

  const handleAddWatch = (item) => {
    setSelectedItems((prevItems) => {
      if (!prevItems.find((selected) => selected.id === item.id)) {
        return [...prevItems, item];
      }
      return prevItems;
    });
  };

  const handleDeleteWatch = (id) => {
    setSelectedItems((prevItems) =>
      prevItems.filter((item) => item.id !== id)
    );
  };
  
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-center">Product List</h1>
      <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mt-6">
        {items.map((item) => (
          <div
            key={item.id}
            className="bg-white rounded-lg shadow p-4 flex flex-col items-center"
            onClick={() => handleAddWatch(item)}
          >
            <img
              src={item.imageUrl}
              alt={item.name}
              className="w-32 h-32 object-contain rounded cursor-pointer"
            />
            <h2 className="text-lg font-bold mt-2">{item.name}</h2>
            <p className="text-gray-600 text-sm">{item.description}</p>
            <p className="font-bold mt-1">Quantity: {item.quantity}</p>
            <p className="text-gray-500 text-xs mt-1">
              (Click image to add quantity.)
            </p>
          </div>
        ))}
      </div>

      {/* Selected Watches Section */}
      {selectedItems.length > 0 && (
        <>
          <h2 className="text-2xl font-bold text-center mt-10">Add Card</h2>
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mt-4">
            {selectedItems.map((item) => (
              <div
                key={item.id}
                className="bg-white rounded-lg shadow p-4 flex flex-col items-center"
              >
                <img
                  src={item.imageUrl}
                  alt={item.name}
                  className="w-32 h-32 object-contain rounded"
                />
                <h2 className="text-lg font-bold mt-2">{item.name}</h2>
                <p className="text-gray-600 text-sm">{item.description}</p>
                <p className="font-bold mt-1">Quantity: {item.quantity}</p>
                <button
                  onClick={() => handleDeleteWatch(item.id)}
                  className="bg-red-500 text-white rounded px-3 py-1 text-sm mt-2"
                >
                  Delete
                </button>
              </div>
            ))}
          </div>
        </>
      )}
    </div>
  );
};

export default Products;
